import React, { Component, useState } from "react";

import datas from "../DummyData.json";
import { Bar, Doughnut, Line } from "react-chartjs-2";
import store from "../../store";
import "bootstrap/dist/css/bootstrap.min.css";

import Typography from "@material-ui/core/Typography";

import GridLayout from "react-grid-layout";
import { Responsive as ResponsiveGridLayout } from "react-grid-layout";

import "react-dates/lib/css/_datepicker.css";
import moment from "moment";

import calender from "../Calender";
import { DateRangePicker } from "react-dates";

import DatePicker from "react-datepicker";

import Dropdown from "react-dropdown";

import { Auth } from "aws-amplify";

import * as ActionConstructer from "../../actions/ActionConstructer";

import { registerLocale, setDefaultLocale } from "react-datepicker";
import es from "date-fns/locale/es";
import { Container } from "aws-amplify-react";

// import getVenues from "./getVenues";

registerLocale("es", es);

class Chart extends Component {
  state = {
    venues: [],

    selectedOption: "1",

    focusedInput: null,

    startDate: moment().subtract(10, "years"),
    endDate: moment(),

    // moment().format("YYYY-MM-DD hh-mm-ss")

    alderFra: "1",
    alderTil: "100",
    gender: "NULL",

    vistedUsers: {
      labels: [],
      datasets: [],
    },
    patronUsers: {
      labels: [],
      datasets: [],
    },
    durationOfStay: {
      labels: [],
      datasets: [],
    },
    visitingUsers: {
      labels: [],
      datasets: [],
      total: [],
    },
  };

  async componentDidMount() {
    var datoFra = this.state.startDate.format("YYYY-MM-DD hh:mm:ss");
    var datoTil = this.state.endDate.format("YYYY-MM-DD hh:mm:ss");
    var alderFra = this.state.alderFra;
    var alderTil = this.state.alderTil;
    var gender = this.state.gender;
    var venue = this.state.selectedOption.value;

    this.fetchVenues("Customer_0");
    this.fetchVisitedUsers(datoFra, datoTil, alderFra, alderTil, gender, venue);
    this.fetchPatronUsers(datoFra, datoTil, alderFra, alderTil, gender, venue);
    this.fetchDurationOfStay(
      datoFra,
      datoTil,
      alderFra,
      alderTil,
      gender,
      venue
    );
    this.fetchVistingUsers(datoFra, datoTil, alderFra, alderTil, gender, venue);
  }

  // 2020-01-1%2022:23:00
  // 2021-10-1%2023:23:00

  /* var URL =
      "https://a60ad7y7e0.execute-api.eu-central-1.amazonaws.com/test?customerId=Customer0&venueId=1&timeStampStart=" +
      this.state.datoFra +
      "&timeStampEnd= " +
      this.state.datoTil +
      "&action=delivery&ageEnd=" +
      this.state.alderTil +
      "&zipCodeStart=0000&zipCodeEnd=9000&gender=" +
      this.state.gender +
      "&ageStart=" +
      this.state.alderFra;
 */

  fetchVenues(customerId) {
    var URL =
      "https://atvetw1fud.execute-api.eu-central-1.amazonaws.com/dev?customerId=" +
      customerId;

    console.log(URL);

    fetch(URL, {
      headers: {
        // "Content-Type": "application/json",
        // "Access-Control-Allow-Origin": "http://localhost:3000/chart",
        Authorization: store.getState().IdToken,
      },
      mode: "cors",
    })
      .then((response) => response.json())
      .then((repos) => {
        this.setState({
          venues: repos.VenueId,
        });

        console.log(this.state.venues);
      });
  }

  fetchVisitedUsers(startDate, endDate, alderFra, alderTil, gender, venue) {
    var URL =
      "https://a60ad7y7e0.execute-api.eu-central-1.amazonaws.com/dev?action=retrieval&customerId=Customer_0&venueId=" +
      venue +
      "&timeStampStart=" +
      startDate +
      "&timeStampEnd=" +
      endDate +
      "&ageEnd=" +
      alderTil +
      "&zipCodeStart=0000&zipCodeEnd=9000&gender=" +
      gender +
      "&ageStart=" +
      alderFra;

    console.log(URL);

    fetch(URL, {
      headers: {
        // "Content-Type": "application/json",
        // "Access-Control-Allow-Origin": "http://localhost:3000/chart",
        Authorization: store.getState().IdToken,
      },
      mode: "cors",
    })
      .then((response) => response.json())
      .then((repos) => {
        this.setState({
          vistedUsers: {
            labels: repos.x,
            datasets: [
              {
                data: repos.y,
              },
            ],
          },
        });

        console.log(this.state.vistedUsers);
      });
  }

  fetchPatronUsers(startDate, endDate, alderFra, alderTil, gender, venue) {
    var URL =
      "https://lrsik6gsgh.execute-api.eu-central-1.amazonaws.com/dev?customerId=Customer_0&venueId=" +
      venue +
      "&timeStampStart=" +
      startDate +
      "&timeStampEnd=" +
      endDate +
      "&ageEnd=" +
      alderTil +
      "&zipCodeStart=0000&zipCodeEnd=9000&gender=" +
      gender +
      "&ageStart=" +
      alderFra;

    console.log(URL);

    fetch(URL, {
      headers: {
        // "Content-Type": "application/json",
        // "Access-Control-Allow-Origin": "http://localhost:3000/chart",
        Authorization: store.getState().IdToken,
      },
      mode: "cors",
    })
      .then((response) => response.json())
      .then((repos) => {
        this.setState({
          patronUsers: {
            labels: repos.x,
            datasets: [
              {
                data: repos.y,
              },
            ],
          },
        });

        console.log(this.state.patronUsers);
      });
  }

  fetchDurationOfStay(startDate, endDate, alderFra, alderTil, gender, venue) {
    var URL =
      "https://ljkp2u0md2.execute-api.eu-central-1.amazonaws.com/dev?customerId=Customer_0&venueId=" +
      venue +
      "&timeStampStart=" +
      startDate +
      "&timeStampEnd=" +
      endDate +
      "&ageEnd=" +
      alderTil +
      "&zipCodeStart=0000&zipCodeEnd=9000&gender=" +
      gender +
      "&ageStart=" +
      alderFra;

    console.log(URL);

    fetch(URL, {
      headers: {
        // "Content-Type": "application/json",
        // "Access-Control-Allow-Origin": "http://localhost:3000/chart",
        Authorization: store.getState().IdToken,
      },
      mode: "cors",
    })
      .then((response) => response.json())
      .then((repos) => {
        this.setState({
          durationOfStay: {
            labels: repos.x,
            datasets: [
              {
                data: repos.y,
              },
            ],
          },
        });

        console.log(this.state.durationOfStay);
      });
  }

  fetchVistingUsers(startDate, endDate, alderFra, alderTil, gender, venue) {
    var URL =
      "https://a60ad7y7e0.execute-api.eu-central-1.amazonaws.com/dev?action=delivery&customerId=Customer_0&venueId=" +
      venue +
      "&timeStampStart=" +
      startDate +
      "&timeStampEnd=" +
      endDate +
      "&ageEnd=" +
      alderTil +
      "&zipCodeStart=0000&zipCodeEnd=9000&gender=" +
      gender +
      "&ageStart=" +
      alderFra;

    console.log(URL);

    fetch(URL, {
      headers: {
        // "Content-Type": "application/json",
        // "Access-Control-Allow-Origin": "http://localhost:3000/chart",
        Authorization: store.getState().IdToken,
      },
      mode: "cors",
    })
      .then((response) => response.json())
      .then((repos) => {
        if (repos.y != null) {
          this.setState({
            visitingUsers: {
              labels: repos.x,
              datasets: [
                {
                  data: repos.y,
                },
              ],
              total: repos.y.reduce((result, number) => result + number),
            },
          });
        }

        console.log(this.state.visitingUsers);
      });
  }

  // setGradientColor = (canvas, color) => {
  //   const ctx = canvas.getContext("2d");
  //   const gradient = ctx.createLinearGradient(0, 0, 600,500);
  //   gradient.addColorStop(0,color)
  //   gradient.
  // };

  getVistedChart = () => {
    const data = this.state.vistedUsers;
    if (data.datasets) {
      let colors = ["rgba(217, 39, 39, 1)", "rgba(75,192,192,0.4)"];
      data.datasets.forEach((set, i) => {
        set.backgroundColor = colors[i];
        set.borderColor = "white";
        set.borderWidth = 2;
        set.label = "";
        set.fill = false;
        set.lineTension = 0.1;
        set.backgroundColor = "rgba(75,192,192,0.4)";
        set.borderColor = "rgba(75,192,192,1)";
        set.borderCapStyle = "round";
        set.borderDash = [];
        set.borderDashOffset = 0.0;
        set.borderJoinStyle = "miter";
        set.pointBorderColor = "rgba(75,192,192,1)";
        set.pointBackgroundColor = "#fff";
        set.pointBorderWidth = 1;
        set.pointHoverRadius = 5;
        set.pointHoverBackgroundColor = "rgba(75,192,192,1)";
        set.pointHoverBorderColor = "rgba(220,220,220,1)";
        set.pointHoverBorderWidth = 2;
        set.pointRadius = 1;
        set.pointHitRadius = 10;
      });
    }
    return data;
  };

  getDurationChart = () => {
    const data = this.state.durationOfStay;
    if (data.datasets) {
      let colors = ["rgba(217, 39, 39, 1)", "rgba(75,192,192,0.4)"];
      data.datasets.forEach((set, i) => {
        set.backgroundColor = colors[i];
        set.borderColor = "white";
        set.borderWidth = 2;
        set.label = "";
        set.fill = false;
        set.lineTension = 0.1;
        set.backgroundColor = "rgba(75,192,192,0.4)";
        set.borderColor = "rgba(75,192,192,1)";
        set.borderCapStyle = "round";
        set.borderDash = [];
        set.borderDashOffset = 0.0;
        set.borderJoinStyle = "miter";
        set.pointBorderColor = "rgba(75,192,192,1)";
        set.pointBackgroundColor = "#fff";
        set.pointBorderWidth = 1;
        set.pointHoverRadius = 5;
        set.pointHoverBackgroundColor = "rgba(75,192,192,1)";
        set.pointHoverBorderColor = "rgba(220,220,220,1)";
        set.pointHoverBorderWidth = 2;
        set.pointRadius = 1;
        set.pointHitRadius = 10;
      });
    }
    return data;
  };

  getPatronChart = () => {
    const data = this.state.patronUsers;
    if (data.datasets) {
      let colors = ["rgba(217, 39, 39, 1)", "rgba(75,192,192,0.4)"];
      data.datasets.forEach((set, i) => {
        set.backgroundColor = colors[i];
        set.borderColor = "white";
        set.borderWidth = 2;
        set.label = "";
        set.fill = false;
        set.lineTension = 1;
        set.backgroundColor = "rgba(75,192,192,0.4)";
        set.borderColor = "rgba(75,192,192,1)";
        set.borderCapStyle = "round";
        set.borderDash = [];
        set.borderDashOffset = 0.0;
        set.borderJoinStyle = "miter";
        set.pointBorderColor = "rgba(75,192,192,1)";
        set.pointBackgroundColor = "#fff";
        set.pointBorderWidth = 1;
        set.pointHoverRadius = 5;
        set.pointHoverBackgroundColor = "rgba(75,192,192,1)";
        set.pointHoverBorderColor = "rgba(220,220,220,1)";
        set.pointHoverBorderWidth = 2;
        set.pointRadius = 1;
        set.pointHitRadius = 10;
      });
    }
    return data;
  };

  getVisitingChart = () => {
    const data = this.state.visitingUsers;
    if (data.datasets) {
      let colors = ["rgba(217, 39, 39, 1)", "rgba(75,192,192,0.4)"];
      data.datasets.forEach((set, i) => {
        set.backgroundColor = colors[i];
        set.borderColor = "red";
        set.borderWidth = 2;
        set.label = "";
        set.fill = false;
        set.lineTension = 0.1;
        set.backgroundColor = "rgba(75,192,192,0.4)";
        set.borderColor = "rgba(75,192,192,1)";
        set.borderCapStyle = "round";
        set.borderDash = [];
        set.borderDashOffset = 0.0;
        set.borderJoinStyle = "miter";
        set.pointBorderColor = "rgba(75,192,192,1)";
        set.pointBackgroundColor = "#fff";
        set.pointBorderWidth = 1;
        set.pointHoverRadius = 5;
        set.pointHoverBackgroundColor = "rgba(75,192,192,1)";
        set.pointHoverBorderColor = "rgba(220,220,220,1)";
        set.pointHoverBorderWidth = 2;
        set.pointRadius = 1;
        set.pointHitRadius = 10;
      });
    }
    return data;
  };

  handleSubmit = async (event) => {
    event.preventDefault();

    var datoFra = this.state.startDate.format("YYYY-MM-DD hh:mm:ss");
    var datoTil = this.state.endDate.format("YYYY-MM-DD hh:mm:ss");
    var alderFra = this.state.alderFra;
    var alderTil = this.state.alderTil;
    var gender = this.state.gender;
    var venue = this.state.selectedOption.value;

    this.fetchVenues("Customer_0");
    this.fetchVisitedUsers(datoFra, datoTil, alderFra, alderTil, gender, venue);
    this.fetchPatronUsers(datoFra, datoTil, alderFra, alderTil, gender, venue);
    this.fetchDurationOfStay(
      datoFra,
      datoTil,
      alderFra,
      alderTil,
      gender,
      venue
    );
